import React from 'react';

const DashboardPage = () => {
  return (
    <div style={{ color: 'white', padding: '2rem' }}>
      <h1>Welcome to your Dashboard!</h1>
      <p>This page is protected. You can only see it if you are logged in.</p>
    </div>
  );
};

export default DashboardPage;
